    return(
        <>
        <Flex flexDirection="column" minHeight="100vh" backgroundRepeat="no-repeat" backgroundPosition="" backgroundImage="url('https://images.unsplash.com/photo-1583648542585-d5f9b9c989a3?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=387&q=80')"></Flex>
        <Footer/>
        
        </>
    )
}
